
describe('Algorithms', () => {

    describe('Strings', () => {

        describe('Alternating Characters', () => {

            it('Sample Test Case', () => {
                var data = 'AAAA\nBBBBB\nABABABAB\nBABABA\nAAABBB'.split("\n");
                var correctResults = [3,4,0,0,4];
                for (var idx = 0; idx < data.length; idx++) {
                    var input = data[idx];
                    var ac = new AlternatingCharacters(input);
                    expect(ac.GetCharactersRemoved()).toBe(correctResults[idx]);
                }
            });

            it('Test Case #1', () => {
                var data = "ABABBABAAB\nBABAABBAAB\nAAAABBAAAA\nBABBABABBA\nAABBBBAAAA\nBAAAABBBBB\nBBABAAAABB\nBBBAAABBAB\nBABAAABBBB\nAAAABAABBB".split("\n");
                var correctResults = [2,3,7,2,7,7,5,5,5,6];

                for (var idx = 0; idx < data.length; idx++) {
                    var input = data[idx];
                    var ac = new AlternatingCharacters(input);
                    expect(ac.GetCharactersRemoved()).toBe(correctResults[idx]);
                }
            });

            it('Test Case #9, 10000 character string', () => {
var input = "";

                var ac = new AlternatingCharacters(input);
                expect(ac.GetCharactersRemoved()).toBe(49979);
            });
        });

    });

});